00046         public static PackObjectInfo GetPackObjectInfo(Type type)
00047         {
00048             PackObjectInfo info;
00049             if (packObjInfoLookup.TryGetValue(type, out info))
00050                 return info;
00051 
00053             var packType = Type.GetType("Pack_" + type.Name);
00054             if (packType != null)
00055             {
00056                 Debug.LogError("BRUTE FORCE Pack_" + type.Name + ". This shouldn't happen.");
00057                 packType.GetMethod("Initialize").Invoke(null, null);
00058             }
00059 
00060             if (packObjInfoLookup.TryGetValue(type, out info))
00061                 return info;
00062 
00063 #if UNITY_EDITOR
00064             Debug.LogWarning("PackObject code has not been generated for type '" + type.Name + "'. Is Code Generation disabled in " + typeof(PackObjectSettings).Name + "?");
00065 #endif
00066             return null;
00067         }
